class Brand{constructor(e){this.ID=0,this.Name=e.Brand,this.CrueltyFree=1===e.Cruelty_Free,this.AnimalTesting=1===e.Animal_Testing,this.ParentCompany={Name:e.Parent_Brand,CrueltyFree:1===e.Parent_Cruelty_Free,AnimalTesting:1===e.Parent_Animal_Testing}}static getAll(e){return new Promise(t=>Ajax.Post("brands",{body:{query:e},success:{ok:e=>{t(e.body.map(e=>Object.assign(new Brand({}),{Name:e.Name,ID:e.ID})))},any:e=>{e.ok||t([])}}}))}}